import React from 'react';

const MarkerList = ({ markers, onMarkerClick }) => {
  return (
    <div className="marker-list">
      {markers.map((marker) => (
        <div key={marker.slug} className="marker-item" onClick={() => onMarkerClick(marker)}>
          {marker.star_rating}
        </div>
      ))}
    </div>
  );
};

export default MarkerList;
